- Ao pesquisar o código de grupo de antecipação de afiliado que tenha pelo menos 1 grupo, ele esta indo direto para a outra tela porém não carrega o grupo na grid (ex: Código 2);
- Faltando implementar funcionalidade de permissão no botão de salvar >> componente BTSALVAR; 
- Pesquisar código de grupo de antecipação de afiliado 2 >> voltar >> clicar no botão (3 pontinhos) da grid >> clicar no salvar >> erro;
- Pesquisar código de grupo de antecipação de afiliado 3 >> clicar no botão salvar >> sim >> após voltar para a primeira tela não consegue mais limpar/pesquisar;
- Pesquisar código de grupo de antecipação de afiliado 3 >> clicar no botão salvar >> botão cancelar da modal não funcionando;
- Ao setar a data final de uma tabela de antecipação e sem salvar voltar para a tela inicial, o campo data final vai estar preenchido;
- Esta sendo possível criar uma nova tabela de antecipação informando data de início menor que a data atual;
- Esta sendo possível criar uma nova tabela de antecipação informando data final menor que a data atual;
- Esta sendo possível criar uma nova tabela de antecipação informando data final menor que a data início; 
- Esta sendo possível criar uma nova tabela de antecipação informando uma mesma descrição que outra tabela de antecipação;
- Criar nova tabela de antecipação >> incluir grupo >> salvar >> não >> a tela fica travando não funcionando;
- Pesquisar uma tabela de antecipação sem data final e que tenha grupos associados, setar uma data final e salvar >> sim para a finalização dos grupos >> erro: Erro ao inserir. Registro duplicado no banco de 
dados!;
- Modal para pesquisa de Grupos para a associação carregar assim que abre (?);
- Pesquisar uma tabela de antecipação >> alterar a descrição para uma já em uso >> salvar >> erro;
- Pesquisar uma tabela de antecipação >> alterar a data início para menor que a data atual >> salvar >> erro;
- Pesquisar uma tabela de antecipação >> alterar a data final para menor que a data atual >> salvar >> sim >> erro >> Erro ao inserir. Registro duplicado no banco de dados!;
- Pesquisar uma tabela de antecipação >> alterar a data final para menor que a data início >> salvar >> sim >> erro >> Erro ao inserir. Registro duplicado no banco de dados!;
- Pesquisar uma tabela de antecipação >> alterar a data final para uma data válida >> salvar >> sim >> erro >> Erro ao inserir. Registro duplicado no banco de dados!;
- Pesquisar uma tabela de antecipação informando apenas a data início >> erro; 
- Pesquisar uma tabela de antecipação informando apenas a data final >> erro;
- Pesquisar uma tabela de antecipação informando apenas a data início e final >> erro;
- Esta sendo possível associar um novo grupo com o mesmo código que já se encontra em vigência a tabela de antecipação;
- Não esta críticando quando vai incluir um novo grupo colocando a data final menor que a data início;
- Realizar alteração do grupo para dia útil >> savlar >> erro
- Não esta críticando ao editar a data início do grupo com data menor que atual;

